import React, { Component } from 'react';

class LeadForm extends Component {
    state = { 
        last_contact: "",
        status_id: "",
        priority_id: "",
        customer_id: "",
        owner_id: ""
    }

    render() { 
        return (
            <div>
                <h3>Add New Lead</h3>
                <form>
                    <div className="form-group">
                        <input 
                            type="text"/>
                    </div>
                </form>
            </div>
        );
    }
}

export default LeadForm;
